import React from 'react';
import styled, { css } from 'styled-components';
import icon from '../../Assets/Home.png';

const CoursesCont = styled.div`
    display:flex;
    align-items: center;
    margin-right: 
`;
const CoursesIcon = styled.div`
    ${() => css`
        width:18px;
        height:20px;
        background-image: url(${icon});
        background-color:white;
        padding:10px;
        background-repeat: no-repeat;
        background-position: center;
        `}
    `;
const CoursesText = styled.p`
    font-family: sans-serif;
    font-size: 12px;
    color:${props => props.color ? props.color : "#3D5AF1"};
`;



const Courses = ({ }) => {
    return <CoursesCont>
        <CoursesIcon /><CoursesText>Menu 1</CoursesText>
    </CoursesCont>
}

export default Courses;
